









CREATE OR REPLACE FUNCTION public.set_gardenid_before_insert()
  RETURNS trigger
AS $BODY$
BEGIN
  -- Automatically set gardenId based on vegetableId
  NEW."gardenId" := (SELECT "gardenId" FROM "Vegetable" WHERE id = NEW."vegetableId" LIMIT 1);
  RETURN NEW;
END;
$BODY$
  LANGUAGE plpgsql;


CREATE OR REPLACE TRIGGER trigger_set_gardenid_before_insert
  BEFORE INSERT
  ON public."Sale"
  FOR EACH ROW
  EXECUTE PROCEDURE public.set_gardenid_before_insert();



ALTER SEQUENCE "User_id_seq" RESTART WITH 6;

ALTER SEQUENCE "Garden_id_seq" RESTART WITH 13;

ALTER SEQUENCE "Vegetable_id_seq" RESTART WITH 61;

ALTER SEQUENCE "Sale_id_seq" RESTART WITH 1001;
